package ar.edu.itba.geb.compiler.java.syntaxtree;import ar.edu.itba.geb.compiler.java.visitors.TypeVisitor;import ar.edu.itba.geb.compiler.java.visitors.Visitor;public class StringArrayType implements Type {  private static StringArrayType instance = new StringArrayType();  public static StringArrayType instance() {    return instance;  }  private StringArrayType() { }  public void accept(Visitor v) {    v.visit(this);  }  public Type accept(TypeVisitor v) {    return v.visit(this);  }  @Override  public String toString() {    return "String[]";  }}